import styled from "styled-components";

const NavbarWrapper = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px 10px;
  width: 100%;
  height: 50px;
  background-color: #271815;
  color: #FFFFFF;
`;

const SearchBar = styled.div`
  background-color: #FFFFFF;

`;

const Navbar = () => (
    <NavbarWrapper>
        <span>Logo</span>
        <SearchBar>

        </SearchBar>
    </NavbarWrapper>
);

export default Navbar;
